def minPath(grid, k):
    N = len(grid)
    directions = [(0, 1), (1, 0), (-1, 0), (0, -1)]
    min_path = [float('inf')] * k

    def dfs(x, y, path, steps):
        if steps == k:
            nonlocal min_path
            min_path = min(min_path, path)
            return
        for dx, dy in directions:
            nx, ny = x + dx, y + dy
            if 0 <= nx < N and 0 <= ny < N:
                dfs(nx, ny, path + [grid[nx][ny]], steps + 1)

    for i in range(N):
        for j in range(N):
            dfs(i, j, [grid[i][j]], 1)

    return min_path

def tri(n):
