    tribonacci_seq = [3]
    for i in range(1, n + 1):
        if i % 2 == 0:
            tribonacci_seq.append(1 + i / 2)
        else:
            if i == 1:
                tribonacci_seq.append(tribonacci_seq[i - 1])
            else:
                tribonacci_seq.append(tribonacci_seq[i - 1] + tribonacci_seq[i - 2] + tribonacci_seq[i + 1 - 3])
    return tribonacci_seq

